chart_avg_win_rate.query:
q = load "${App.Datasets.opportunitysplits_revinsights.FullyQualifiedName}";
closed = filter q by 'Opportunity.IsClosed' == "true";
won = filter q by 'Opportunity.IsWon' == "true";
closed_a = filter closed by {{row(CloseDate_1.selection, [0], ["min", "max"]).asDateRange("date('Opportunity.CloseDate_Year', 'Opportunity.CloseDate_Month', 'Opportunity.CloseDate_Day')")}};
won_a = filter won by {{row(CloseDate_1.selection, [0], ["min", "max"]).asDateRange("date('Opportunity.CloseDate_Year', 'Opportunity.CloseDate_Month', 'Opportunity.CloseDate_Day')")}};
closed_b = filter closed by date('Opportunity.CloseDate_Year', 'Opportunity.CloseDate_Month', 'Opportunity.CloseDate_Day') in ["{{coalesce(cell(date_last_year.result, 0, "last_year") ,"1 fiscal_quarter ago").asString()}}".."{{coalesce(cell(date_last_year.result, 0, "last_year") ,"1 fiscal_quarter ago").asString()}}"];
won_b = filter won by date('Opportunity.CloseDate_Year', 'Opportunity.CloseDate_Month', 'Opportunity.CloseDate_Day') in ["{{coalesce(cell(date_last_year.result, 0, "last_year") ,"1 fiscal_quarter ago").asString()}}".."{{coalesce(cell(date_last_year.result, 0, "last_year") ,"1 fiscal_quarter ago").asString()}}"];
result_a = group closed_a by all full, won_a by all;
result_a = foreach result_a generate count(won_a)/count(closed_a)*100 as 'this_period';
result_b = group closed_b by all full, won_b by all;
result_b = foreach result_b generate count(won_b)/count(closed_b)*100 as 'last_year';
result = group result_a by all full, result_b by all;
result = foreach result generate round(sum(result_a['this_period']),0) as 'This Period', round(sum(result_b['last_year']),0) as 'Same Time Last Year';

