closed_won_last_7_days.query:
q = load "${App.Datasets.OpportunityHistory.FullyQualifiedName}";
q = filter q by 'Opp.IsWon' == "false";
a = filter q by date('ValidFromDate_Year', 'ValidFromDate_Month', 'ValidFromDate_Day') in [.."8 days ago"];
a = filter a by date('ValidToDate_Year', 'ValidToDate_Month', 'ValidToDate_Day') in ["7 days ago"..];
b = filter q by date('ValidFromDate_Year', 'ValidFromDate_Month', 'ValidFromDate_Day') in [.."current day"];
b = filter b by date('ValidToDate_Year', 'ValidToDate_Month', 'ValidToDate_Day') in ["1 day ahead"..];
a = group a by all, b by all;
a = foreach a generate sum(a['${Constants.HistoricalAmount}']) as 'Amount_7_days_ago', sum(b['${Constants.HistoricalAmount}']) as 'Amount_current';
a = foreach a generate  ('Amount_current' - 'Amount_7_days_ago') / 'Amount_7_days_ago' as 'percent_change';

